import { VappNetworkInterfaceListJson } from './__json__';
import { VappNetworkInterface } from './vapp-network-interface';

/* istanbul ignore next: autogenerated */
export class VappNetworkInterfaceList {

  constructor(private _json: VappNetworkInterfaceListJson) {
  }

  /**
   * Get data.
   * @returns {Array<VappNetworkInterface>}
   */
  get data(): Array<VappNetworkInterface> {
    return this._json.data.map((vappNetworkInterface) => {
      return new VappNetworkInterface(vappNetworkInterface);
    });
  }

  /**
   * Get the json representation of this class.
   * @returns {VappNetworkInterfaceListJson}
   */
  get json(): VappNetworkInterfaceListJson {
    return Object.assign({}, this._json);
  }

  /**
   * Get the string representation of this class.
   * @returns {string}
   */
  toString(): string {
    return JSON.stringify(this._json, undefined, 2);
  }
}
